let ClientID;
const Client = io("http://localhost:5000")
const {Logged, setLogged} = useState(false)
Client.on("socket-id", ({ID}) => {
  ClientID = ID
})
const root = ReactDOM.createRoot(document.getElementById('root'))
root.render(<App />)
export default {Client: Client, CID: ClientID};
